import React from 'react'
import Data from './colleges.json'
import Image from "./images/college_02.jpg"
const Card=()=> {
    return (
      <div className="App">
       
          { Data.colleges.map((post) => {
            return (
              <>
             
               <div className="card-container">
                   <div className="image-container">
                       <img src={Image} alt=""/>
                       <h3 style={{marginRight:"200px",fontWeight:"bold",color:"gray"}}>{post.college_name} 
                       <h3 style={{marginLeft:"180px",fontSize:"11px",color:"gray" }}><s>{post.original_fees}</s></h3>
                       </h3>
                        <p style={{marginRight:"30px",fontSize:"12px"}}>{post.nearest_place} | <span style={{color:"gray"}}>{post.dis}</span> <span style={{marginLeft:"90px",fontSize:"30px"}}>{post.discounted_fees}</span></p>
                     
                   </div>
                  
               </div>
              </>
            )
          })}
        </div>
    
    );
  }
  
export default Card
